import React, { Component } from 'react';
import Contacts from './components/Contacts';
import './App.css';

class App extends Component {
	render() {
		return (
			<div className="App">
				<p>Contact Manger</p>
				<div className="container">
					<Contacts />
				</div>
			</div>
		);
	}
}

export default App;
